## correct continental shift in temperature records
east_corrected <- east %>% dplyr::select(paste0('X', 2:23)) %>% imap(~{
e_corr <- .x %>% cbind( east %>% dplyr::select(c('x', 'y')) )%>% setNames(c(.y, 'x', 'y')) %>% mutate(x = case_when(x > -50 ~ x + round((2/21) * str_remove(.y, 'X') %>% as.numeric()), x < -50 ~ x - round((7/21) * str_remove(.y, 'X') %>% as.numeric()))) %>% distinct(x,y, .keep_all = T) %>% filter(complete.cases(.))
st_as_sf(e_corr, coords = c('x', 'y'))
})

raster_corrected <- east_corrected %>% imap(~{ rasterFromXYZ(data.frame(st_coordinates(.x), 'Temp' = .x %>% pull(.y)))})
