e_corr <- .x %>% cbind( east %>% dplyr::select(c('x', 'y')) )%>% setNames(c(.y, 'x', 'y')) %>% distinct(x,y, .keep_all = T) %>% filter(complete.cases(.))
st_as_sf(e_corr, coords = c('x', 'y'))
}) |> imap(~{ rasterFromXYZ(data.frame(st_coordinates(.x), 'Temp' = .x %>% pull(.y)))})
saveRDS(raster_corrected, 'Data/temperature_grid/raster_corrected.rds') saveRDS(raster_temp, 'Data/temperature_grid/raster_temp.rds')

