# Function to convert raster to data frame and assign the period name
raster_to_df <- function(raster, period) {
  raster_df <- as.data.frame(raster, xy = TRUE)
  raster_df$period <- period
  return(raster_df)
}

# define a function that will compute richnness
compute_richness <- function(subset_fossil, sample, time_order, region, taxa = "FAMILY"){
fam_matrix_all <- xtabs(formula(paste0("~ midpoint_period + ", taxa)), subset_fossil)
rar_fam <- vegan::rarefy(fam_matrix_all, sample, se = T) |> as.data.frame() |> t() |> as.data.frame() |> rownames_to_column('Stages') |> mutate(Stages = factor(Stages, levels = time_order), region = region) |> filter(!is.na(Stages))
return(rar_fam)
}

## Compute the dissimilarity between regions and periods

matrix_counts <- function(data, stage){

  mc <- xtabs(formula(paste0(stage,"~grid_id_5+GENUS")), data)

  mc <- mc[mc |> rowSums() != 0,]

  return(mc)
} 

