## define a function to assign time periods based on literature thresholds
change_time_to_period <- function(MIN_AGE){ case_when(round(MIN_AGE) %in% c(21:23) ~ 'Aquitanian', round(MIN_AGE) %in% c(16:20) ~ 'Burdigalian', round(MIN_AGE) %in% c(14:15) ~ 'Langhian', round(MIN_AGE) %in% c(12:13) ~ 'Serravallian', round(MIN_AGE) %in% c(11:8) ~ 'Tortonian', round(MIN_AGE) %in% c(5:7) ~ 'Messinian', round(MIN_AGE) %in% c(4:5) ~ 'Zanclean', round(MIN_AGE) %in% c(2:3) ~ 'Piacenzian')
}
change_period_to_midpoint <- function(period) { case_when( period == 'Aquitanian' ~ mean(c(21, 23)), period == 'Burdigalian' ~ mean(c(16, 20)), period == 'Langhian' ~ mean(c(14, 15)), period == 'Serravallian' ~ mean(c(12, 13)), period == 'Tortonian' ~ mean(c(8, 11)), period == 'Messinian' ~ mean(c(5, 7)), period == 'Zanclean' ~ mean(c(4, 5)), period == 'Piacenzian' ~ mean(c(2, 3)), TRUE ~ NA_real_ # Return NA if no match ) }

assign_grid_id <- function(xydat, grid){


my_list <- st_intersects(xydat, grid)
my_list[lengths(my_list) == 0] <- NA

return(unlist(my_list, use.names = FALSE))

}

get_env_var <- function(rot_lng, rot_lat, midpoint_period){
point_p <- sp::SpatialPoints(matrix(c(rot_lat,rot_lng), nrow = 1), proj4string =CRS("+proj=longlat +datum=WGS84"))
# Define the target projection # target_crs <- CRS("+proj=laea +lat_0=45 +lon_0=-30 +datum=WGS84 +units=m")
# Reproject the point # reprojected_point <- spTransform(point_p, target_crs)
# extract values (# points auto project to match raster projection) t_slope <- raster::extract(temporal_slope[[midpoint_period]], reprojected_point) t_var <- raster::extract(temporal_variance[[midpoint_period]], reprojected_point) t_svar <- raster::extract(spatial_variance[[midpoint_period]], reprojected_point) t_mean <- raster::extract(mean_temp[[midpoint_period]], reprojected_point)
return(data.frame(t_slope, t_var,t_svar, t_mean))
}

fossil_with_env_var <- subset_fossil |> group_by(midpoint_period)|> select(rot_lng, rot_lat, midpoint_period)
