# extract values (# points auto project to match raster projection) t_slope <- raster::extract(temporal_slope[[.y]], .x$geometry |> st_as_sf()) t_var <- raster::extract(temporal_variance[[.y]], .x$geometry |> st_as_sf()) t_svar <- raster::extract(spatial_variance[[.y]], .x$geometry |> st_as_sf()) t_mean <- raster::extract(mean_temp[[.y]], .x$geometry |> st_as_sf())
return(data.frame(t_slope, t_var,t_svar, t_mean))
}) |> bind_rows() |> bind_cols(subset_fossil)

# Function to convert a single raster layer to a data frame
raster_to_df <- function(rast_layer) {
  df <- as.data.frame(rast_layer, xy = TRUE, na.rm = TRUE)
  colnames(df) <- c("x", "y", "value")
  return(df)
}

# Function to create a ggplot map for a given data frame and layer name
create_map <- function(df, layer_name) {
  ggplot() +
    geom_raster(data = df, aes(x = x, y = y, fill = value)) +
    coord_fixed() +
    scale_fill_viridis_c(name = layer_name, option = "C") +
    theme_minimal() +
    labs(title = layer_name, x = "Longitude", y = "Latitude") +
    theme(
      plot.title = element_text(size = 14, face = "bold", hjust = 0.5),
      axis.title = element_text(size = 12)
    ) 
}

